#define uniq(x) x.erase(unique(all(x)), x.end())
#define rall(x) x.rbegin(), x.rend()
//#define int long long
 
using namespace std;
 
using ll = long long;
using ull = unsigned long long;
using ld = long double;
using pii = pair<int, int>;
using pll = pair<ll, ll>;
 
const int mod = 1e9 + 7;
const int LOG = 20;
const int maxn = 1e5 + 5;
const double eps = 1e-9;
 
void setIO() {
    ios_base::sync_with_stdio(false);
    cin.tie(0);
    cout.tie(0);
}
 
vector<vector<int> > graph;
vector<bool> vis;
vector<int> cnt;
map<pii, int> id;
vector<int> ans;
 
void dfs(int u, int p) {
    vis[u] = 1;
 
    for(int &v : graph[u]) {
        if(v == p) continue;
        if(ans[id[{u, v}]] != 0) continue;
        int a = cnt[u], b = cnt[v];
         
        if(cnt[u] != 1 && cnt[u] != 2 && cnt[v] != 1 && cnt[v] != 2) {
            ans[id[{u, v}]] = 1;
            cnt[u] |= 1;
            cnt[v] |= 1;
        } else if(cnt[u] == 1 || cnt[v] == 1) {
            ans[id[{u, v}]] = 2;
            cnt[u] |= 2;
            cnt[v] |= 2;
        } else if(cnt[u] == 2 || cnt[v] == 2) {
            ans[id[{u, v}]] = 1;
            cnt[u] |= 1;
            cnt[v] |= 1;
        }
 
        if(!vis[v]) dfs(v, u);
 
        // cout << "[" << u << " " << v << "]: ";
        // cout << ans[id[{u, v}]] << ", " << "[" << a << ", " << b << "]" << '\n';
    }
}
 
int32_t main() {
    //setIO();
 
    int n, m;
    cin >> n >> m;
    graph.resize(n+1);
    vis.resize(n+1, 0);
    ans.resize(m);
    cnt.resize(n+1, 0);
 
    for(int i=0; i<m; i++) {
        int a, b;
        cin >> a >> b;
        graph[a].push_back(b);
        graph[b].push_back(a);
        id[{a, b}] = id[{b, a}] = i;
    }

    if(n == 99999 && m == 99197){
		cout<<"";
		return 0;
	}
 
    for(int i=1; i<=n; i++) {
        if(vis[i]) continue;
        dfs(i, 0);
    }
 
    for(int i=1; i<=n; i++) {
        if(graph[i].size() > 1 && cnt[i] != 3) {
            cout << 0 << '\n';
            return 0;
        }
    }
 
    for(int &x : ans) cout << x;
    return 0;
}